import React from "react";
import "./App.css";
import {HashRouter, Route} from "react-router-dom";
import Table from "./components/Table";

function App() {
  return (
    <div className="App">
      <HashRouter>
        <div>
          <Route
            exact
            path="/*"
            component={props => (
              <Table props={path.match.params[0] || "#"} {...props} />
            )}
          />
        </div>
      </HashRouter>
    </div>
  );
}

export default App;
